#
# TABLE STRUCTURE FOR: cast_studios
#

DROP TABLE IF EXISTS `cast_studios`;

CREATE TABLE `cast_studios` (
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(60) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'name of cast studio',
  `cast_language_flag_id` int(10) unsigned DEFAULT NULL COMMENT 'language of broadcast',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: countries
#

DROP TABLE IF EXISTS `countries`;

CREATE TABLE `countries` (
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'country name',
  `flag_id` int(10) unsigned NOT NULL COMMENT 'link to flag image',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=241 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: disciplines
#

DROP TABLE IF EXISTS `disciplines`;

CREATE TABLE `disciplines` (
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'name of disciplines: DotA2, Counter-Strike, etc.',
  `media_id` int(10) unsigned NOT NULL COMMENT 'logo of discipline',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: matches
#

DROP TABLE IF EXISTS `matches`;

CREATE TABLE `matches` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `team_1_id` int(10) unsigned NOT NULL,
  `team_2_id` int(10) unsigned NOT NULL,
  `start_at` datetime NOT NULL COMMENT 'date and time of the beginning of the match',
  `active_status_id` tinyint(3) unsigned NOT NULL COMMENT 'status of tournament upcoming, ongoing, recent',
  `final_score` varchar(15) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'result of match (ex. 2:1)',
  `winner_team` int(10) unsigned DEFAULT NULL COMMENT 'team name of the winner of match',
  `cast_at` varchar(2000) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'a link to broeadcaster of match at twtch, youtube, etc.',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: media
#

DROP TABLE IF EXISTS `media`;

CREATE TABLE `media` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `filename` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'name of file path',
  `file_size` int(10) unsigned NOT NULL COMMENT 'the size of object',
  `metadata` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`metadata`)),
  `media_type_id` tinyint(3) unsigned NOT NULL COMMENT 'type of media',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: media_types
#

DROP TABLE IF EXISTS `media_types`;

CREATE TABLE `media_types` (
  `id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'names of media types',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: player_profiles
#

DROP TABLE IF EXISTS `player_profiles`;

CREATE TABLE `player_profiles` (
  `player_id` int(10) unsigned NOT NULL,
  `first_name` varchar(60) COLLATE utf8mb4_unicode_ci NOT NULL,
  `last_name` varchar(60) COLLATE utf8mb4_unicode_ci NOT NULL,
  `last_team_id` int(10) unsigned DEFAULT NULL COMMENT 'id of the previous team which player was belong to',
  `career_teams` varchar(2000) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'the list of teams which player played for',
  `career_start` date NOT NULL COMMENT 'date of first official players'' game',
  `career_end` date DEFAULT NULL COMMENT 'date of last official players'' game',
  `career_prize` int(10) unsigned DEFAULT NULL COMMENT 'total amount of prize in career',
  `media_id` int(10) unsigned NOT NULL COMMENT 'an avatar of player',
  `flag_id` int(10) unsigned NOT NULL,
  `birthplace` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: players
#

DROP TABLE IF EXISTS `players`;

CREATE TABLE `players` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nickname` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'ingame name of player',
  `country_id` smallint(5) unsigned NOT NULL COMMENT 'origin of player',
  `current_team_id` int(10) unsigned DEFAULT NULL COMMENT 'id of the team which player belongs to',
  `currrent_discipline_id` int(10) unsigned NOT NULL COMMENT 'id of discipline which player represent now',
  `is_active` tinyint(1) DEFAULT NULL COMMENT 'is the player active now',
  `team_function_id` tinyint(3) unsigned NOT NULL COMMENT 'the role of player in the team',
  `add_info` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: statuses
#

DROP TABLE IF EXISTS `statuses`;

CREATE TABLE `statuses` (
  `id` tinyint(3) unsigned NOT NULL,
  `name` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'status name for matches and tournaments',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: teams
#

DROP TABLE IF EXISTS `teams`;

CREATE TABLE `teams` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'team tag or nickname ',
  `discipline_id` int(10) unsigned NOT NULL COMMENT 'discipline of which is the team or single player',
  `country_id` smallint(5) unsigned NOT NULL COMMENT 'a nationality of current roster',
  `default_country` smallint(5) unsigned NOT NULL COMMENT 'a country of team foundament',
  `media_id` int(10) unsigned NOT NULL COMMENT 'logo of the team',
  `add_info` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: tournament_operators
#

DROP TABLE IF EXISTS `tournament_operators`;

CREATE TABLE `tournament_operators` (
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(60) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'name of organization',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: tournament_profiles
#

DROP TABLE IF EXISTS `tournament_profiles`;

CREATE TABLE `tournament_profiles` (
  `tournament_id` int(10) unsigned NOT NULL,
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'name of tournament',
  `tournament_operator_id` smallint(5) unsigned DEFAULT NULL COMMENT 'an id of organization which is provide tournament',
  `location` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'place of holding of tournament',
  `cast_studio_id` smallint(5) unsigned DEFAULT NULL COMMENT 'broadcaster of tournament',
  `discipline_id` smallint(5) unsigned NOT NULL COMMENT 'name of tournaments',
  `media_id` int(10) unsigned NOT NULL COMMENT 'a logo of tournament',
  `country_id` smallint(5) unsigned NOT NULL COMMENT 'a country of tournament placement',
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: tournaments
#

DROP TABLE IF EXISTS `tournaments`;

CREATE TABLE `tournaments` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `discipline_id` smallint(5) unsigned NOT NULL COMMENT 'name of tournaments',
  `active_status_id` tinyint(3) unsigned NOT NULL COMMENT 'status of tournament upcoming, ongoing, recent',
  `begins_at` date NOT NULL COMMENT 'date of start of tournament',
  `ends_at` date DEFAULT NULL COMMENT 'date of finish of tournament ',
  `prize` int(10) unsigned DEFAULT NULL COMMENT 'prize pool',
  `participants_num` smallint(5) unsigned DEFAULT NULL COMMENT 'number of participants',
  `location` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'place of holding of tournament',
  `is_online` tinyint(1) DEFAULT NULL COMMENT 'is the tournament via net or an offline tournament in a particular place',
  `winner` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'team or nickname of winner',
  `add_info` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



